content.description:
Dijital Ürün;
Ürün anahtarları ve satınalma detayı SMS & E-mail ile gönderilecektir.;
Dijital ürünlerde, Mesafeli Satışlar Yönetmeliği’nin 15. maddesi uyarınca ürün iadesi ve iptali yapılamaz.;
Ürünler kargo veya posta ile gönderilmez.;
Dijital kart ürünlerinde, platform oyunu ve oyun içi kod satışlarında, Türk Ticaret Kanunu ilgili maddesi uyarınca, ürün iadesi yoktur.;
Ürünler siparişi takip eden günün mesai saatleri içinde gerekli güvenlik kontrolleri yapıldıktan sonra sms ve e-posta ile iletilmektedir.;
Oyun kod, oyun içi kod ve kart kodlarını kullanabilmek için 3. firmalara üye ve login olmanız (Steam, Origin, LOL, Xbox vs.), ürün anahtarını girerek oyunları/hizmetleri uyumlu cihazınıza indirmeniz gerekir.;
Kullanmış olduğunuz bilgisayar/telefon/tablet özelliklerine göre oyun performanslarında değişiklikler yaşanabilir.;
Ürün isminde yazan DLC ibaresi eklenti paketini ifade eder. Ürün isminde MAC ibaresi ise Apple bilgisayar ile uyumlu olduğunu ifade eder.;
